                <img src="assets/layout/images/logo-black.png" alt="babylon-layout" />
                <h1>
                    <span className="exception-name">PAGE</span> NOT FOUND
                </h1>
                <p>Requested resource is not available.</p>
                <a href="/#">Back to Dashboard</a>
            </div>
        </div>
    );
};
